    if (prop.nombre === "-") {return ( <> - </>)

    } else {
        if (prop.foto === undefined ){
            return(
                <div className="Machinebox_div">
                <div className="tooltip">{prop.nombre}

                </div>
            </div>
            )} else {

        return (
        <div className="Machinebox_div">
            <div className="tooltip">{prop.nombre}
                <figure className="tooltiptext">
